import { Link } from "react-router-dom";

const NavBar = () => {
    return ( 
        <nav>
            <Link to="/">Home</Link>
            <Link to="/contact">Contact</Link>
            <Link to="/about">About</Link>
            <Link to="/LoginPage">About</Link>

            </nav>
     );
}
 
export default NavBar;
